query: |-
  SELECT
      c.id AS customer_id,
      c.first_name,
      c.last_name,
      COUNT(o.id) AS order_count
  FROM
      jaffle_shop.customers as c
  LEFT JOIN
      jaffle_shop.orders o
  ON c.id = o.user_id
  GROUP BY
      c.id, c.first_name, c.last_name
  ORDER BY
      order_count DESC;
